Smart, sexy Allison can&apos;t help but fall in love with Philip, a dashing software billionaire, and they quickly marry. But soon this new bride begins to think her hubby was involved in the mysterious death of his first wife. This suspicious newlywed needs to get to the truth - but as things turn dangerous, she may not make it to their first anniversary!


=====================================================================================

